import React from "react";
import Footer from "../components/Footer";
import Navbar from "../components/Navbar";
import "./routesCss/Resume.css";

const Resume = () => {
	return (
		<>
			<Navbar />
			<div className="resumeContainerDiv">
				<div className="resumeTop"></div>
				<div className="resumeBottom">
					<div className="resumeProjects">
						<h2>Projects</h2>
					</div>
					<div className="resumeExtra">
						<div className="resumeSummary">
							<h2>Summary</h2>
						</div>
						<div className="resumeSkills">
							<h2>Skills</h2>
						</div>
						<div className="resumeEducation">
							<h2>Education</h2>
						</div>
					</div>
				</div>
			</div>
			<Footer />
		</>
	);
};

export default Resume;
